// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

interface IERC8004 {
    event AgentCreated(uint256 indexed agentId, address owner);
    function executeTask(uint256 agentId, bytes calldata data) external returns (bytes memory);
}

contract MyAIAgent is IERC8004, Ownable {
    struct Agent {
        string name;
        string metadataURI; // Chứa thông tin về Model AI (GPT-4, Llama, v.v.)
        bool active;
    }

    mapping(uint256 => Agent) public agents;
    uint256 public nextAgentId;

    constructor() Ownable(msg.sender) {}

    function createAgent(string memory _name, string memory _uri) external {
        agents[nextAgentId] = Agent(_name, _uri, true);
        emit AgentCreated(nextAgentId, msg.sender);
        nextAgentId++;
    }

    function executeTask(uint256 agentId, bytes calldata data) external override returns (bytes memory) {
        require(agents[agentId].active, "Agent không hoạt động");
        // Logic xử lý tác vụ ở đây
        return abi.encode("Task Completed");
    }
}

